"use strict";$(document).ready(function(){$('[data-action-target="#acSecctingsActionMessage"]').click(function(e){e.preventDefault();const t=Swal.mixin({customClass:{confirmButton:"btn btn-success m-1",cancelButton:"btn btn-danger m-1"},buttonsStyling:!1});t.fire({title:"Delete Account",text:"You want to delete this account!!!",icon:"warning",showCancelButton:!0,confirmButtonText:"Yes, Delete it!",cancelButtonText:"No, cancel!",reverseButtons:!0}).then(e=>{e.value?t.fire("Deleted!","Account Deleted Successfully.","success"):e.dismiss===Swal.DismissReason.cancel&&t.fire("Cancelled","Your imaginary file is safe :)","error")})})});